import App from "./App";
//import 'bootstrap/dist/css/bootstrap.css';

ReactDOM.render(<App/>, document.getElementById("root"));

window.onload =() => {
    randomUserGenerator()
}
const randomUserGenerator = async () => {
    try {
        fetch('https://randomuser.me/api')
    .then((response) => {
        return response.json()
    }).then((data) => {
        console.log(data.results[0]);
        const firstName = data.results[0].name.first;
        const lastName = data.results[0].name.last;
        const email = data.results[0].name.last;
        const streetNumber = data.results[0].name.last;
        const streetName = data.results[0].name.last;
        const city = data.results[0].name.last;
        const state = data.results[0].name.last;
        const country = data.results[0].name.last;
        const postalCode = data.results[0].name.last;
        const dateOfBirth = data.results[0].name.last;
        const phoneNumber = data.results[0].name.last;
        const cellNumber = data.results[0].name.last;
        const pictureLarge = data.results[0].name.last;
        const pictureThumbnail = data.results[0].name.last;
    })
} catch (error) {
    console.log(error);
}


